import "./About.scss";
import { Container, Row, Col } from "react-bootstrap";

function About() {
  return (
    <Container>
      <Row className="about">
        <Row>
          <h2>About me</h2>
        </Row>
      </Row>
    </Container>
  );
}

export default About;
